import React, { Component } from "react";
import { db } from "..fire/";
import { Button } from "reactstrap";

export default class SelectMultiple extends Component {
  state = {
    data: [],
    selectedLabels: []
  };
  componentDidMount() {
    db.collection("Models")
      .get()
      .then(querySnapshot => {
        const data = querySnapshot.docs.map(doc => doc.data());
        // console.log(data);
        var temp = [];
        for (var i = 0; i < data.length; i++) {
          temp.append(data[i].label);
        }
        this.setState({ data: temp }); // array of cities objects
      });
  }
  render() {
    return (
      <div>
        {this.state.selectedLabels((label, index) => (
          <Button color="primary">{label}</Button>
        ))}
      </div>
    );
  }
}
